import so from './Profile.module.css';
import MyPosts from './MyPosts/MyPosts';

const Profile = () => {
    return(
        <section className={so.section}> 
        <h2>{props.h}</h2>
            <img className={so.img} src="https://proprikol.ru/wp-content/uploads/2020/08/kartinki-krutyh-mashin-57.jpg" alt="main"/>
            <div className="Profile">
                <div>
                    ava + description
                </div>
                <MyPosts />
            </div>
        </section>
    )
}
export default Profile;
